import React from 'react';
import styled from 'styled-components';
import Youtube from './Youtube';

const Projects = () => {
  return (
    <Wrapper>
      <H2>featured projects</H2>
      <Description>
        <div>
          Keg inventory system using Untappd API integration.
        </div>
        <div>
          Frontend: React & Styled Components
        </div>
        <div>
          Backend: Node.js, Express & MongoDB Atlas
        </div>
          <Youtube embedId="dto_rcA2HWo" />
      </Description>

      <Description>
        <div>
          Bob's Burgers Game
        </div>
        <div>
          Using Vanilla JavaScript, HTML & CSS
        </div>
        <div>
          Play live: https://belcherfamilyfoodfight.netlify.app/
        </div>
  
        <Youtube embedId="7Obar6Y30cU" />
        
      </Description>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100vw;
`;

const H2 = styled.h2`
  text-transform: uppercase;
  font-size: 2rem;
  font-weight: 700;
  margin: 30px 0;
  margin-top: 50px;
  text-shadow: 2px 2px 0px #CCF4D5;
`;

const Description = styled.div`
  margin-top: 25px;
  display: flex;
  line-height: 1.5;
  flex-direction: column;
  font-size: 1.2rem;
  max-width: 90vw;
`;

export default Projects;
